import React from "react";
import menucocina from "../img/01-menu-cocina.svg";
import { Link } from "react-router-dom";

const Boton = () => {
  //return <h1>Aqui estoy, mirame</h1>;
  <Link to="?Orders">
    <img src={menucocina} />
  </Link>;
};

export default Boton;
